--
-- Name: media_usage _RETURN; Type: RULE; Schema: public; Owner: patreon_user
--

CREATE OR REPLACE VIEW public.media_usage AS
 SELECT mf.id,
    mf.file_hash,
    mf.file_type,
    mf.file_path,
    mf.file_size,
    mf.mime_type,
    mf.width,
    mf.height,
    mf.duration,
    mf.metadata,
    mf.reference_count,
    mf.first_seen_at,
    mf.created_at,
    count(pm.id) AS usage_count
   FROM (public.media_files mf
     LEFT JOIN public.post_media pm ON ((pm.media_id = mf.id)))
  GROUP BY mf.id;


